//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_haraka_256s

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/katzenpost/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("cdc31d62e90b9b15320d3c1aebea0e0940787c212d8666b4096e2ce02144ff50fa0ffea9a856861a8a074bcfd2ff632786dc36e1dacf863afcf87bc3753b6d07c0dbf5174e4abbf926b63723287647a593a4b4c8f932a5dc16b4f18f67730565afc924c2940eda660c65547d81a869aa88bd209f33086ab237f2cda551850572")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("c0dbf5174e4abbf926b63723287647a593a4b4c8f932a5dc16b4f18f67730565afc924c2940eda660c65547d81a869aa88bd209f33086ab237f2cda551850572")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

	signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
